import React from 'react'
import { useCategoriesContext } from "../../hooks/usePostListContext";
import ListGroup from 'react-bootstrap/ListGroup';
import styles from '../../styles/Dashboard.module.css';
import { FaTrashAlt } from "react-icons/fa";
import Table from 'react-bootstrap/Table';
import Image from 'react-bootstrap/Image';






const Dashboard: React.FC = () => {

  interface Post {
    title: string;
  }

  const posts: Post[] = useCategoriesContext();
  console.log(posts,'PPPPPPP')

  return (
    <ListGroup as="ul" className={styles.postListContainer}>

      <Table striped>
        <thead>
          <tr>
            <th>Title</th>
          </tr>
        </thead>
        <tbody>
          {posts.map((post: Post, item: any) => (
            <tr key={item.id}>
              <td className={styles.thumbnail}><Image src={item.imageUrl}/>jk</td>
              <td className={styles.titleColumn}>{post.title}</td>
              <td className={styles.iconColumn}>
                <FaTrashAlt />
              </td>
            </tr>
          ))}
        </tbody>

      </Table>
    </ListGroup>

  )
}

export default Dashboard
